import Layout from '../components/Layout';
const Dashboard = () => (
    <Layout title ='Dash Board'>
    <p>This is Dashboard</p>
    <style global jsx>{`
        body{
            background:red;
        }
    `}
    
    </style>
    </Layout>
    
);
export default Dashboard;
